package main

import (
	"strings"
	"testing"
)

func TestPadEncrypt(t *testing.T) {
	output := pad_encrypt("foo", otp, "123456979879")[:25]
	expectedOutput := "102, 111, 112, 36, 38, 39"
	if output != expectedOutput {
		t.Errorf("Expected output(%s) is not same as actual output(%s)", expectedOutput, output)
	}
}

func TestPadDecrypt(t *testing.T) {
	output := pad_decrypt(decrypt_input, otp, "123456979879")
	expectedOutput := "foo"
	if output != expectedOutput {
		t.Errorf("Expected output(%s) is not same as actual output(%s)", expectedOutput, output)
	}
}

func TestTransformPad(t *testing.T) {
	output, _ := transform_pad("8466836185 486413651 8641153168 486186851361 816161856", "489486516841681861254651321685465")
	expectedOutput := []string{"105845750 85974199 8281607625 443690594338 761921497"}
	string1 := strings.Join(output, " ")
	string2 := strings.Join(expectedOutput, " ")
	if string1 != string2 {
		t.Errorf("Expected output(%s) is not same as actual output(%s)", string2, string1)
	}
}

